import { ProductsList } from "./components/product-all";
import { Productfilter } from "./components/product-filter";
import {products} from '../../backend/db/products';
// import {}
export default function ProductWithFilter() {
  return (
    <div className="filter-page">
      <section className="filter-product-container">
        <Productfilter />
      </section>
      <section className="products">
        <div className="section-title">
          <h2>our products</h2>
        </div>
        <div className="products-center">
          {products.map(({ _id,
    name,
    subtitle,
    categories,
    rating,
    price,
    discount,
    image})=>{
            <ProductsList
            productFilterImg={image}
            imgAlt={"product"}
            title={name}
            productSubtitle={subtitle}
            starRating={rating}
            productPrice={p}
            productDiscount={"40%"}
          />
          })}
          <ProductsList
            productFilterImg={productImg2}
            imgAlt={"product"}
            title={"Mast & Harbour"}
            productSubtitle={"Women yellow Solid Bomber Jacket"}
            starRating={"3.5"}
            productPrice={"2799"}
            productDiscount={"40%"}
          />
        </div>
      </section>
    </div>
  );
}
